// Helper to remove quotes.
	final private String unquote(String quoted)
	{
		char q = quoted.charAt(0);
		if (q != '"' && q != '\'')
			return quoted;

		char[] unquoted = new char[quoted.length()];
		char c;
		int j = 0;
		for (int i = 1; i < quoted.length() - 1; i++)
		{
			c = quoted.charAt(i);
			if (c == q) // shouldn't be needed (unless occurring in middle of quoted)
			{
				// ignore...
			}
			else if (c == '\\')
			{
				i ++;
				c = quoted.charAt(i);
				switch (c)
				{
					case '0' :
					case '1' :
					case '2' :
					case '3' :
					case '4' :
					case '5' :
					case '6' :
					case '7' : {
						int n = 0, m = 0;
						do
						{
							n = (n << 3) + (c - '0');
							i++;
							c = quoted.charAt(i);
							++m;
						}
						while (m < 3 && '0' <= c && c <= '7');
						unquoted[j++] = (char) n;
					}
						break;
					//  case 'a': unquoted[j++] = '\a'; break; Bell not supported
					case 'b' :
						unquoted[j++] = '\b';
						break;
					case 'f' :
						unquoted[j++] = '\f';
						break;
					case 'n' :
						unquoted[j++] = '\n';
						break;
					case 'r' :
						unquoted[j++] = '\r';
						break;
					default :
						unquoted[j++] = c;
				}
			}
			else
			{
				unquoted[j++] = c;
			}
		}

		return new String(unquoted);
	}

/* Main entry points. */

	final public int scanTerm(Sink sink, Reader input) throws IOException
	{
		yyreset(input);
		makeBase(sink);
		yybegin(Before);
		int result = yylex();
		popBase();

		return result;
	}

	final public int loadTerm(Sink sink, String name) throws IOException
	{
		FileReader reader = new FileReader(name);
		scanTerm(sink, reader);

		return 1;
	}


